import React from 'react';



export const Alphabet = (props) => {
    console.log("Alphabet: " + props.alphabet)
        return(
            <div className="ui grid container alphabet">
                {props.alphabet.map(letter=>{
                   for(let i = 0; i < props.difficultLetters.length; i++){
                       if(letter === props.difficultLetters[i]){
                           return <div style={{color: "red"}} className="ui item draggable" key={letter}>{letter}</div>
                        } else {
                            return <div className="ui item draggable" key={letter}>{letter}</div>
                        }
                    }
                })}
            </div>
         )
            
    }
